import { render } from '@testing-library/react';
import './App.css';

import Data from './data.json';
function App() {

      fetch('./data.json')
      .then(response => response.json())
      .then(data => {
        console.log(data);
      })
      .catch(error => {
        console.log(error);
      });
      // afficher les données json dans la page
      return (
        <div className="App">
          <header className="App-header">
            <p>
              {Data.map((item) => (
                <div>
                  <h1>{item.id}</h1>
                  <p>{item.age}</p>
                </div>
              ))}
            </p>
          </header>
        </div>
      );


}
export default App;
